import React, { useState, useRef } from 'react';
import { Container, Typography, List, ListItem, ListItemText, Divider, Box, Accordion, AccordionSummary, AccordionDetails, Tabs, Tab } from '@mui/material';
import { useParams } from 'react-router-dom';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const PreDefinedPath = ({ pathways }) => {
  const { id } = useParams();
  const [list, setList] = useState(pathways[id].steps); // Initialize list state
  const [expandedItem, setExpandedItem] = useState(null); // Track the expanded item

  const dragItem = useRef();
  const dragOverItem = useRef();

  const dragStart = (e, position) => {
    dragItem.current = position;
    console.log(e.target.innerHTML);
  };

  const dragEnter = (e, position) => {
    dragOverItem.current = position;
    console.log(e.target.innerHTML);
  };

  const drop = (e) => {
    const copyListItems = [...list]; // Use the list state instead of pathways[id].steps
    const dragItemContent = copyListItems[dragItem.current];
    copyListItems.splice(dragItem.current, 1);
    copyListItems.splice(dragOverItem.current, 0, dragItemContent);
    dragItem.current = null;
    dragOverItem.current = null;
    setList(copyListItems); // Update the list state
  };

  const toggleDetails = (itemIndex) => {
    // Toggle the expanded item between open and closed
    if (expandedItem === itemIndex) {
      setExpandedItem(null); // Collapse if already expanded
    } else {
      setExpandedItem(itemIndex); // Expand if not expanded
    }
  };

  return (
    <>
        <div style={{
      backgroundColor: '#9CBBE9',
      color: 'white',
      padding: '20px',
      textAlign: 'center',
      borderRadius: '10px', /* Rounded corners for the container */
      boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)' /* Box shadow for depth effect */
    }}>
      <h1 style={{ fontSize: '2rem', marginBottom: '10px' }}>{pathways[id].title}</h1>
      <p style={{ fontSize: '1.2rem', marginBottom: '10px' }}>{pathways[id].desc}</p>
      <p style={{ fontSize: '1rem' }}>Average Pay: ${pathways[id].pay}</p>
    </div>

    <div style={{ display: 'flex', width: '100%' }}>
  <div style={{ flex: 1 }}>
    {list.map((item, index) => (
      <Box
        sx={{
          backgroundColor: 'white',
          boxShadow: '0px 0px 5px rgba(0, 0, 0, 0.3)',
          transition: 'background-color 0.3s',
          '&:hover': {
            backgroundColor: '#FFCCB6',
          },
          margin: '20px',
          cursor: 'pointer',
          border: expandedItem === index ? '2px solid #FAC8A8' : '2px solid transparent',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          padding: '10px',
          textAlign: 'left',
          width: '80%', // Set a fixed width for the container
        }}
        key={item.id}
        onDragStart={(e) => dragStart(e, index)}
        onDragEnter={(e) => dragEnter(e, index)}
        onDragEnd={drop}
        draggable
        onClick={() => toggleDetails(index)}
      >
        <h1 style={{ marginBottom: '10px' }}>{index + 1}</h1>
        {item.content}
        <Accordion expanded={expandedItem === index}>
          <AccordionSummary
            expandIcon={<ExpandMoreIcon />}
            onClick={(e) => {
              e.stopPropagation();
              toggleDetails(index);
            }}
          >
            <Typography variant="h6">Skills You'll Gain</Typography>
          </AccordionSummary>
          <AccordionDetails>
            <ul className="skills-list">
              {item.skills && item.skills.map((skill, skillIndex) => (
                <li key={skillIndex}>
                  <strong>{skill.name}</strong>: {skill.description} ({skill.type})
                </li>
              ))}
            </ul>
          </AccordionDetails>
        </Accordion>
      </Box>
    ))}
  </div>
</div>
</>
  );
};
export default PreDefinedPath;
